import { Link } from "react-router-dom";
import styles from "./Landing.module.css";
import LandingImage2 from "./_.jpeg";

const Landing = () =>{

    return (
        <div className='intro'>
             <Link to={'/home'}>Click here to start
                <div className="overlay"></div>
                <div className="content">

               <h1 className={styles.title}>Hi! Welcome to the henry PI Food</h1>

                <h2 className={styles.by}>Developed by: Maria Elizabeth Ortiz </h2>
                <h2 className={styles.start}>click here to start</h2>


            </div>

            <video src={LandingImage2} autoPlay loop muted/>


            </Link>

        </div>


  );
};

export default Landing;
